import math
import os
import random
import re
import sys


#
# Complete the 'larrysArray' function below.
#
# The function is expected to return a STRING.
# The function accepts INTEGER_ARRAY A as parameter.
#

def rotate(arr):
    return [arr[1], arr[2], arr[0]]


def select_rotation_idx(num, A):
    looking_num = num + 1

    idx = A.index(looking_num) if A.index(looking_num) - 2 >= 0 else 0

    if idx == 0 or idx == 1:
        return slice(0, 3)
    elif num > 0 and A[idx - 1] == num and len(A) - (idx + 1) > 1:
        return slice(idx, idx + 3)
    elif num > 0 and A[idx - 2] == num and len(A) - (idx + 1) > 0:
        return slice(idx - 1, idx + 2)
    else:
        return slice(idx - 2, idx + 1)


def larrysArray(A):
    idx = 0
    correct_position = [False] * len(A)

    while True:
        # print('new slices!', end=' ')
        slices = select_rotation_idx(idx, A)
        # print(f'A: {A}, Slice: {slices}, idx= {idx}')

        if (A[idx] == idx + 1 and idx == 0) or (A[idx] == idx + 1 and A[idx - 1] == idx):
            correct_position[idx] = True
            # print('Add Correct Position!', idx)
            idx += 1

            if idx == len(A):
                # print(f'Final: {A}')
                return 'YES'
        else:
            rotated = rotate(A[slices])
            if correct_position[A.index(rotated[0]) - 1] == True:
                return 'NO'

            A[slices] = rotated


